import { Container } from "@mui/material";
import Navbar from "./Components/Navbar/Navbar";
import Home from "./Components/Home/Home";

const App = () => {
  return (
    <Container maxWidth="lg">
      <Navbar />
      <Home />
    </Container>
  );
};

export default App;
